        <img src={logo} className="App-logo" alt="logo" />
        <p>

  Lorem ipsum dolor sit amet consectetur adipisicing elit. Natus doloremque repellendus quibusdam vitae sapiente quod quia, porro enim inventore quidem rem sed totam unde ipsam tempore facilis, fugiat nostrum deleniti!
